import React from "react";

function Search(){
    return <form className="search" class="form-inline justify-content-center">
             <div class="form-group mx-sm-3 mb-2 mt-">
               <input type="password" class="form-control w-200" id="inputPassword2" placeholder="" />
             </div>
             <button type="submit" class="btn btn-light mb-2">Search</button>
           </form>
}

export default Search;
